const buttonStyle = {
  background: "#007bff",
  color: "#fff",
  border: "none",
  borderRadius: "6px",
  padding: "0.4rem 0.8rem",
  cursor: "pointer",
  fontWeight: "bold",
  transition: "background 0.3s",
};
